function App() {
  return (
    <div className="App">
 {/* <Router>      */}
<Switch>
   <Route  path="/CardPage"><CardPage/></Route>
   <Route  path="/ForgotPassword"><ForgotPassword/></Route>
   <Route  path="/Register"><Register/></Route>
   <Route  path="/Login"><Login/></Route>
<LoginPage path="/"/>

</Switch>
{/* </Router> */}
          </div>
  );
}

export default App;
